import React, { useContext } from 'react';
import{NavLink, useHistory} from 'react-router-dom';
import { AuthContext } from '../context/AuthContext';
import Nav from 'react-bootstrap/Nav'
import 'bootstrap/dist/css/bootstrap.css';


export const Navbar = () =>{
    const history = useHistory();
    const auth = useContext(AuthContext);
    const logoutHendler = event =>{
        event.preventDefault();
        auth.logout();
        history.push('/')
    }
    return(
    <Nav className = "navbar navbar-expand-sm bg-danger">
        <Navbar.Brand href="#" className="navbar-brand">ReadIt</Navbar.Brand>
        <Nav.Item >
             <Nav.Link eventKey="link-1"><NavLink to="/allbooks">AllBooks</NavLink></Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link eventKey="link-2"><NavLink to="/book">Books</NavLink></Nav.Link>
        </Nav.Item>
        <Nav.Item>
        <Nav.Link eventKey="link-3"><a href="/" onClick ={logoutHendler}>LogOut</a></Nav.Link>
        </Nav.Item>
    </Nav>
        
    )
}
